v></div><div class=row-counter><div class=col><div class=counter-number id=num-repo style="color: #145d61;">0+</div><div class=counter-title><strong>Open source</strong> repositories</div></div><div class=col><div class=counter-number id=num-commit style="color: #0a6e70;">0+</div><div class=counter-title><strong>Commits</strong> since Feb. 2020</div></div><div class=col><div class=counter-number id=num-pr style="color: #088385;">0+</div><div class=counter-title><strong>PRs/Issues</strong>solved</div></div><div class=col><div class=counter-number id=num-coffee style="color: #16b6b8;">0+</div><div class=counter-title><strong>Cups of coffee</strong>drunk</div></div></div><a class=row-counter href=https://github.com/jina-ai/jina target=_blank><div class=col><h3 class=inset-title>See you on Github, again!</h3></div></a></div><canvas id=canvas></canvas><script>class Hover3D{constructor(id){this.id=id;this.xOffset=10;this.yOffset=10;this.attack=0.1;this.release=0.5;this.perspective=500;this.create();};create(){document.querySelectorAll(this.id).forEach(element=>{const rectTransform=element.getBoundingClientRect();const perspective="perspective("+this.perspective+"px) ";element.style.setProperty("transform-style","preserve-3d");element.addEventListener("mouseenter",e=>{element.style.setProperty("transition","transform "+this.attack+"s");});element.addEventListener("mousemove",e=>{let dy=e.pageY-rectTransform.top;let dx=e.pageX-rectTransform.left;let xRot=this.map(dx,0,rectTransform.width,-this.xOffset,this.xOffset);let yRot=this.map(dy,0,rectTransform.height,this.yOffset,-this.yOffset);let propXRot="rotateX("+yRot+"deg) ";let propYRot="rotateY("+xRot+"deg)";element.style.setProperty("transform",perspective+propXRot+propYRot);});element.addEventListener("mouseleave",e=>{element.style.setProperty("transition","transform "+this.release+"s");element.style.setProperty("transform",perspective+"rotateX(0deg) rotateY(0deg)");})})};map(value,istart,istop,ostart,ostop){return ostart+(ostop-ostart)*((value-istart)/(istop-istart))}}</script><script>let W=window.innerWidth;let H=window.innerHeight;const canvas=document.getElementById("canvas");const context=canvas.getContext("2d");const maxConfettis=150;const particles=[];const possibleColors=["DodgerBlue","OliveDrab","Gold","Pink","SlateBlue","LightBlue","Gold","Violet","PaleGreen","SteelBlue","SandyBrown","Chocolate","Crimson"];function randomFromTo(from,to){return Math.floor(Math.random()*(to-from+1)+from);};function confettiParticle(){this.x=Math.random()*W;this.y=Math.random()*H-H;this.r=randomFromTo(11,33);this.d=Math.random()*maxConfettis+11;this.color=possibleColors[Math.floor(Math.random()*possibleColors.length)];this.tilt=Math.floor(Math.random()*33)-11;this.tiltAngleIncremental=Math.random()*0.07+0.05;this.tiltAngle=0;this.draw=function(){context.beginPath();context.lineWidth=this.r/2;context.strokeStyle=this.color;context.moveTo(this.x+this.tilt+this.r/3,this.y);context.lineTo(this.x+this.tilt,this.y+this.tilt+this.r/5);return context.stroke();};};function Draw(){const results=[];requestAnimationFrame(Draw);context.clearRect(0,0,W,window.innerHeight);for(var i=0;i<maxConfettis;i++){results.push(particles[i].draw());};let particle={};let remainingFlakes=0;for(var i=0;i<maxConfettis;i++){particle=particles[i];particle.tiltAngle+=particle.tiltAngleIncremental;particle.y+=(Math.cos(particle.d)+3+particle.r/2)/2;particle.tilt=Math.sin(particle.tiltAngle-i/3)*15;if(particle.y<=H)remainingFlakes++;if(particle.x>W+30||particle.x<-30||particle.y>H){particle.x=Math.random()*W;particle.y=-30;particle.tilt=Math.floor(Math.random()*10)-20;}};return results;};window.addEventListener("resize",function(){W=window.innerWidth;H=window.innerHeight;canvas.width=window.innerWidth;canvas.height=window.innerHeight;},false);for(var i=0;i<maxConfettis;i++){particles.push(new confettiParticle());};canvas.width=W;canvas.height=H;Draw();</script></body><script>myHover3D = new Hover3D(".thankyou-card"), $.Tween.propHooks.number = {

    }
